import React from "react";
import "./Footer.css"; // optional

function Footer() {
  return (
    <footer id="contact">
      <p>Contact us: 7683061117 | <a href="https://officebanao.in">officebanao.in</a></p>
      <p>All Rights Reserved &copy; {new Date().getFullYear()}</p>
    </footer>
  );
}

export default Footer;
